import React from 'react';
import { NavLink } from 'react-router-dom';


const CovidCard = (props) =>{
    
    return(
        <>
            <div className="col-md-4 col-10 mx-auto ">
                <div className="card" >                    
                        <div className="card-body">
                            <h5 className="align-items-center">{props.country}</h5>
                            <p className="card-text"> cases: {props.cases} </p><br></br>
                            <p className="card-text"> deaths: {props.deaths} </p><br></br>
                            <p className="card-text"> recovered: {props.cases} </p><br></br>
                            <NavLink to="/services" className="btn btn-primary">Back</NavLink>
                        </div>
                </div>                            
        </div>
        </>
       
    );
}

export default CovidCard;
